DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertarRegistros` ()   BEGIN
    DECLARE contador INT DEFAULT 0;
    WHILE contador < 50 DO
        -- Generar datos aleatorios e insertar en la tabla
            tipo_documento,
            numero_documento,
            nombre,
            edad,
            genero,
            estado_civil,
            correo,
            telefono,
            nivel_estudios,
            tipo_vivienda,
            estrato,
            num_hijos,
            personas_cargo,
            experiencia,
            area_experiencia,
            tiempo_ventas,
            experiencia_general,
            otra_area_experiencia
        ) 
        SELECT 
            (SELECT tipo_documento FROM (SELECT 'Cédula de ciudadanía (CC)' AS tipo_documento UNION ALL SELECT 'Cédula de extranjera (CE)') AS tipo_doc ORDER BY RAND() LIMIT 1),
            FLOOR(RAND() * 9999999999),
            (SELECT 
                CASE 
                    WHEN RAND() < 0.5 THEN (SELECT nombre FROM (SELECT 'Carlos' AS nombre UNION ALL SELECT 'Andrés' UNION ALL SELECT 'Juan' UNION ALL SELECT 'Camilo' UNION ALL SELECT 'Santiago' UNION ALL SELECT 'Daniel' UNION ALL SELECT 'David' UNION ALL SELECT 'Sebastián' UNION ALL SELECT 'Miguel' UNION ALL SELECT 'Jorge' UNION ALL SELECT 'Luis' UNION ALL SELECT 'José' UNION ALL SELECT 'Alejandro' UNION ALL SELECT 'Diego' UNION ALL SELECT 'Manuel' UNION ALL SELECT 'Felipe' UNION ALL SELECT 'Mateo' UNION ALL SELECT 'Óscar' UNION ALL SELECT 'Samuel' UNION ALL SELECT 'Fernando') AS nombres ORDER BY RAND() LIMIT 1)
                    ELSE (SELECT nombre FROM (SELECT 'María' AS nombre UNION ALL SELECT 'Laura' UNION ALL SELECT 'Paula' UNION ALL SELECT 'Ana' UNION ALL SELECT 'Sofía' UNION ALL SELECT 'Valentina' UNION ALL SELECT 'Camila' UNION ALL SELECT 'Daniela' UNION ALL SELECT 'Valeria' UNION ALL SELECT 'Natalia' UNION ALL SELECT 'Luisa' UNION ALL SELECT 'Manuela' UNION ALL SELECT 'Isabella' UNION ALL SELECT 'Juliana' UNION ALL SELECT 'Sara' UNION ALL SELECT 'Mariana' UNION ALL SELECT 'Gabriela' UNION ALL SELECT 'Andrea' UNION ALL SELECT 'Mía' UNION ALL SELECT 'Lucía') AS nombres ORDER BY RAND() LIMIT 1)
                END) AS nombre,
            DATE_FORMAT(DATE_ADD(CURDATE(), INTERVAL -FLOOR(RAND() * (365 * 70)) DAY), '%Y-%m-%d') AS edad,
            (SELECT genero FROM (SELECT 'Masculino' AS genero UNION ALL SELECT 'Femenino') AS generos ORDER BY RAND() LIMIT 1),
            (SELECT estado_civil FROM (SELECT 'Soltero/a' AS estado_civil UNION ALL SELECT 'Casado/a' UNION ALL SELECT 'Union libre' UNION ALL SELECT 'Separado/a' UNION ALL SELECT 'Divorsiado/a') AS estados ORDER BY RAND() LIMIT 1),
            CONCAT(SUBSTRING(MD5(RAND()) FROM 1 FOR 8), '@example.com'),
            FLOOR(RAND() * 999999999),
            (SELECT nivel_estudios FROM (SELECT 'Bachillerato' AS nivel_estudios UNION ALL SELECT 'Formación Técnica/Tecnologo' UNION ALL SELECT 'Formación profesional - Pregrado' UNION ALL SELECT 'Posgrado') AS niveles ORDER BY RAND() LIMIT 1),
            (SELECT tipo_vivienda FROM (SELECT 'Familiar' AS tipo_vivienda UNION ALL SELECT 'Propia' UNION ALL SELECT 'Alquilada') AS viviendas ORDER BY RAND() LIMIT 1),
            FLOOR(RAND() * (6 - 1) + 1) AS estrato,
            FLOOR(RAND() * 6) AS num_hijos,
            FLOOR(RAND() * 6) AS personas_cargo,
            (SELECT experiencia FROM (SELECT 'Sin experiencia' AS experiencia UNION ALL SELECT 'Menor a 1 año' UNION ALL SELECT 'Entre 1 y 2 años' UNION ALL SELECT 'Entre 2 y 4 años' UNION ALL SELECT 'Mayor a 5 años') AS exp ORDER BY RAND() LIMIT 1),
            (SELECT area_experiencia FROM (SELECT 'Sin experiencia' AS area_experiencia UNION ALL SELECT 'Ventas' UNION ALL SELECT 'Servicios de atención' UNION ALL SELECT 'Recuperación y recobro' UNION ALL SELECT 'Back Office (BO)') AS areas ORDER BY RAND() LIMIT 1),
            (SELECT tiempo_ventas FROM (SELECT 'Sin experiencia' AS tiempo_ventas UNION ALL SELECT 'Menor a 1 año' UNION ALL SELECT 'Entre 1 y 2 años' UNION ALL SELECT 'Entre 2 y 4 años' UNION ALL SELECT 'Mayor a 5 años') AS tiempos ORDER BY RAND() LIMIT 1),
            (SELECT experiencia_general FROM (SELECT 'Sin experiencia' AS experiencia_general UNION ALL SELECT 'Menor a 1 año' UNION ALL SELECT 'Entre 1 y 2 años' UNION ALL SELECT 'Entre 2 y 4 años' UNION ALL SELECT 'Mayor a 5 años') AS exp_gen ORDER BY RAND() LIMIT 1),
            (SELECT otra_area_experiencia FROM (SELECT 'Áreas administrativas' AS otra_area_experiencia UNION ALL SELECT 'Servicio al cliente presencial' UNION ALL SELECT 'Venta al cliente presencial' UNION ALL SELECT 'Otros') AS otras_areas ORDER BY RAND() LIMIT 1)
        FROM
            (SELECT 
                SUBSTRING(MD5(RAND()) FROM 1 FOR 8) AS apellido
            ) AS a;
        SET contador = contador + 1;
    END WHILE;
END$$

DELIMITER ;

